import React from 'react';
import logo from './logo.svg';
import './App.css';

function getRandom(min, max) {
    return Math.random() * (max - min) + min;
}


function Input(){
  return (
     <input />
  )
}

function Text(){
  return (
    <input type="text">5</input>
  )
}


function App() {
  return (
  <div className="App">
    <header className="App-header">
    <p>
     Vardhan G, lets do Maths...
     </p>

    <div>
       <Text /> X <Text2/> = <Input />
    </div>

     </header>
  </div>
   )
}

export default App;

